import React, { useEffect, useState } from 'react';
import { getDiaryEntries, deleteDiaryEntry } from '../db';
import { Link } from 'react-router-dom';
import ExportButtons from './ExportButtons';

function DiaryList(props) {
  const [entries, setEntries] = useState([]);
  const [search, setSearch] = useState('');
  const [tagFilter, setTagFilter] = useState('');
  const [moodFilter, setMoodFilter] = useState('');

  useEffect(() => {
    getDiaryEntries().then(setEntries);
  }, [props.refresh]);

  // Filter entries
  const filtered = entries.filter(entry => {
    const matchesSearch = entry.title.toLowerCase().includes(search.toLowerCase()) || entry.content.toLowerCase().includes(search.toLowerCase());
    const matchesTag = tagFilter ? entry.tags.includes(tagFilter) : true;
    const matchesMood = moodFilter ? entry.mood === moodFilter : true;
    return matchesSearch && matchesTag && matchesMood;
  });

  return (
    <div className="backdrop-blur-lg bg-white/80 rounded-2xl shadow-2xl p-6 max-h-[60vh] overflow-y-auto scrollbar-thin scrollbar-thumb-blue-200 scrollbar-track-white/40">
      <h2 className="text-2xl font-bold mb-4 text-transparent bg-clip-text bg-gradient-to-r from-blue-400 via-purple-400 to-pink-400">Diary Entries</h2>
      <div className="flex gap-2 mb-4">
        <input
          type="text"
          className="p-3 border border-blue-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-400 bg-white/60 w-1/2"
          placeholder="Search..."
          value={search}
          onChange={e => setSearch(e.target.value)}
        />
        <input
          type="text"
          className="p-3 border border-purple-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-purple-400 bg-white/60"
          placeholder="Tag filter"
          value={tagFilter}
          onChange={e => setTagFilter(e.target.value)}
        />
        <input
          type="text"
          className="p-3 border border-pink-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-pink-400 bg-white/60"
          placeholder="Mood filter"
          value={moodFilter}
          onChange={e => setMoodFilter(e.target.value)}
        />
      </div>
      <div className="relative">
        <div className="border-l-4 border-blue-300 absolute h-full left-6 top-0"></div>
        <ul className="space-y-8">
          {filtered.map((entry, idx) => (
            <li key={entry.id} className="relative pl-16">
              <Link to={`/entry/${entry.id}`} className="block">
                <div className="absolute left-2 top-2 w-8 h-8 rounded-full bg-gradient-to-r from-blue-400 via-purple-400 to-pink-400 flex items-center justify-center text-white text-2xl shadow-lg">
                  {entry.mood}
                </div>
                <div className="bg-white/80 backdrop-blur-lg rounded-xl shadow p-4 border border-white/40">
                  <div className="flex justify-between items-center mb-2">
                    <div>
                      <span className="font-bold text-xl text-blue-700">{entry.title}</span>
                      <span className="ml-2 text-gray-500">{entry.date}</span>
                      {entry.tags && entry.tags.length > 0 && (
                        <span className="ml-2 text-xs bg-gradient-to-r from-blue-200 via-purple-200 to-pink-200 px-2 py-1 rounded-full text-gray-700">{entry.tags.join(', ')}</span>
                      )}
                    </div>
                    <div className="flex gap-2">
                      <Link
                        to={`/entry/${entry.id}`}
                        className="text-green-600 hover:underline font-semibold"
                        onClick={e => {
                          e.preventDefault();
                          window.history.pushState({}, '', `/entry/${entry.id}`);
                          window.dispatchEvent(new Event('popstate'));
                          setTimeout(() => {
                            const editBtn = document.querySelector('button.bg-green-500');
                            if (editBtn) editBtn.click();
                          }, 100);
                        }}
                      >Edit</Link>
                      <button
                        className="text-red-500 hover:underline font-semibold"
                        onClick={e => { e.preventDefault(); deleteDiaryEntry(entry.id); setEntries(entries.filter(e => e.id !== entry.id)); }}
                      >Delete</button>
                    </div>
                  </div>
                  {entry.image && <img src={entry.image} alt="Diary" className="my-2 max-h-40 rounded-xl shadow" />}
                  <div className="prose max-w-none bg-white/60 p-3 rounded-lg border border-gray-200" dangerouslySetInnerHTML={{ __html: entry.content }} />
                  <ExportButtons entry={entry} />
                </div>
              </Link>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default DiaryList;
